 ///     <AuthorEmail>saadry.dunkel@outlook.com</AuthorEmail>
 ///     <AuthorName>Saadry Dunkel</AuthorName>
 ///     <AuthorUri>https://www.saadry-dunkel.com</AuthorUri>
